          description: 'Custom fuel map',
          type: 'custom',
          editable: true,
          data: fuelMapData
        };
        
        loadFuelMapSelection();
        selectFuelMap(newMapId);
      } else {
        ignitionMaps[newMapId] = {
          name: name,
          description: 'Custom ignition map',
          type: 'custom',
          editable: true,
          data: ignitionMapData
        };
        
        loadIgnitionMapSelection();
        selectIgnitionMap(newMapId);
      }
    }
    
