void generateDodecahedron(dvec3_t face[12][5])
{
	double phi; // Compute golden ratio with fibonacci approximation
	{
		double a = 1;
		double b = 1;
		for (int i = 0; i < 20; i++)
		{
			a = a + b;
			b = a + b;
		}
		phi = b / a;
	}
	int f = 0;
	for (int a = 0; a < 3; a++) // axis loop, per rectangle
	{							// a+1 short axis a+2 long axis
		double s = -1.0;		// axis multiplier for flip along a+1, -1,1
		for (int si = 0; si < 2; si++, s *= -1)
		{
			double l = -1.0; // axis multiplier for flip along a+2, -1,1
			for (int li = 0; li < 2; li++, l *= -1, f++)
			{
				int v = 0; // vertex iterator
				int o = a; // axis iterator
				// generate first two vertices along rectangle short axis
				for (int i = 0; i < 2; i++, s *= -1)
				{
					face[f][v].l[o] = 0;
					face[f][v].l[(o + 1) % 3] = l * phi;
					face[f][v].l[(o + 2) % 3] = s / phi;
					v++;
				}
				// s flipped
				// generate first cube vertex in -s and l direction
				face[f][v].l[o] = s;
				face[f][v].l[(o + 1) % 3] = l;
				face[f][v].l[(o + 2) % 3] = -s;
				v++;
				// generate generate pointy end on a-1 rectangle
				face[f][v].l[(o + 2) % 3] = 0;
				face[f][v].l[(o + 3) % 3] = s * phi;
				face[f][v].l[(o + 4) % 3] = l / phi;
				v++;
				// generate final cube vertex in s and l direction
				face[f][v].l[o] = s;
				face[f][v].l[(o + 1) % 3] = l;
				face[f][v].l[(o + 2) % 3] = s;
			}
		}
	}
}

