public class Tugas2CountingSort {
    /** Membuat function sort, untuk mengurutkan array berdasarkan jumlah frekuensi **/
    void sort(char arr[]) {
        int n = arr.length;
        
        char output[] = new char[n];
        
        /** Array Count[] berfungsi untuk menyimpan jumlah kemunculan tiap karakter ASCII (0-255) **/
        int count[] = new int[256];
        
        System.out.println("\nStep 1 : Inisialisasi count[] ke 0");
        
        for(int i = 0; i < 256; ++i)
        {
            count[i] = 0;
        }
        
        System.out.println("Semua nilai count[i] di-set ke 0");
        
        
        System.out.println("\nStep 2 : Hitung Frekuensi karakter ASCII");
        
        for(int i = 0; i < n; i++)
        {
            ++count[arr[i]];
            System.out.printf("Karakter '%c' ditemukan, count['%c'] sekarang = %d\n", arr[i], arr[i], count[arr[i]]);
        }
        
        /** Menampilkan Frekuensi akhir tiap karakter yang ada **/
        System.out.println("\nFrekuensi akhir : ");
        
        for(int i = 0; i < 256; ++i)
        {
            if(count[i] > 0)
            {
                System.out.printf("  %c : %d kali\n", (char)i, count[i]);
            }
        }
        
        System.out.println("\nStep 3 : Buat Count Kumulatif (untuk menentukan posisi terakhir karakter");
        /** Membuat Count Kumulatif **/
        
        
        int lastCount = 1;
            
        for(int i = 1; i <= 255; ++i)
        {
            
            if(count[i] > 0)
            {
                
                System.out.println("Menkumulatifkan " + count[i] + " dengan " + count[i - 1] );
                count[i] += count[i - lastCount];
                
                lastCount = 1;
            } else {
                lastCount++;
            }
        }
        
        
        /** Cetak hasil Kumulatif karakter yang muncul **/
        System.out.println("Nilai count[] setelah kumulatif:");
        for(int i = 0; i < 256; ++i)
        {
            if(count[i] > 0)
            {
                System.out.printf("   %c : %d\n", (char)i, count[i]);
            }
        }
        
        
        System.out.println("\n Step 4: Penempatan ke output[] berdasarkan count kumulatif");
        /** Menyusun array output[] berdasarkan posisi akhir yang dihitung dari count[]
         * secara Descending
         */
        
        for(int i = n - 1; i >= 0; --i)
        {
            output[n- count[arr[i]]] = arr[i];
            
            int posisi = count[arr[i]] - 1;
            
            System.out.printf("i=%2d | arr[i]='%c' -> count['%c']=%2d -> output[%d]='%c'\n",
                    i, arr[i], arr[i], count[arr[i]], posisi, arr[i]);
            
            --count[arr[i]];
        }
        
       /** Tampilkan hasil output sementara **/
       System.out.println("\nHasil output[] setelah semua penempatan :");
       for(char c : output) System.out.print(c + " ");
       System.out.println();
       
       System.out.println("\nStep 5 : Salin output[] ke arr[]");
       /** Menyalin kembali hasil akhir dari output[] ke array utama arr[] **/
       for(int i = 0; i < n; i++)
       {
           arr[i] = output[i];
           System.out.printf("arr[%2d] = '%c'\n", i, arr[i]);
       }
       
       System.out.println("\nArray sudah terurut sepenuhnya secara descending");
       
        
    }
    
    public static void main(String args[]) {
        /** Deklarasi Variabel **/
        
        char a1 = 'g';
        char a2 = 'e';
        char a3 = 'e';
        char a4 = 'k';
        char a5 = 's';
        char a6 = 'f';
        char a7 = 'o';
        char a8 = 'r';
        char a9 = 'g';
        char a10 = 'e';
        char a11 = 'e';
        char a12 = 'k';
        char a13 = 's';
        
        char arr[] = {a1, a2, a3, a4, a5, a6, a7, a8, a9, a10, a11, a12, a13};
        
        System.out.print("Array sebelum dilakukan sorting : ");
        for (char c : arr) System.out.print(c + " ");
        System.out.println();
        
        
        /** Membuat Variabel Tugas2CountingSort **/
        Tugas2CountingSort ob = new Tugas2CountingSort();
        
        /** Menjalankan function sort **/
        ob.sort(arr);
        
        
        
        System.out.print("\nSetelah dilakukan sorting secara Descending : ");
        for(char c : arr) System.out.print(c + " ");
        
        System.out.println();


       /** Analisa Algoritma Counting Sort **/
       String hasilAnalisa = """
                             ================================================
                              KESIMPULAN ALGORITMA COUNTING SORT
                             ================================================
                             Counting Sort adalah algoritma pengurutan non-komparatif
                             (tanpa perbandingan)yang bekerja dengan cara menghitung jumlah 
                             kemunculan tiap elemen.

                             Proses utama:
                             1. Inisialisasi array count[] berukuran 256 dengan nilai awal 0.
                             2. Hitung jumlah kemunculan setiap karakter dari array input.
                             3. Ubah count[] menjadi bentuk kumulatif untuk mengetahui posisi akhir.
                             4. Tempatkan elemen ke array output[] sesuai posisi kumulatif, 
                                dan disusun secara Descending
                             5. Salin hasil akhir dari output[] ke arr[].

                             Kelebihan:
                             - Sangat cepat untuk rentang data kecil.
                             - Tidak menggunakan perbandingan antar elemen.

                             Kekurangan:
                             - Membutuhkan memori tambahan (array count dan output).
                             - Tidak cocok untuk data dengan rentang nilai yang sangat besar.

                             Contoh hasil:
                             Array awal  : [g, e, e, k, s, f, o, r, g, e, e, k, s]
                             Hasil akhir : [s, s, r, o, k, k, g, g, f, e, e, e, e]
                             ================================================
                             """;
       
       System.out.println(hasilAnalisa);
        

    }
}

import java.util.Arrays;

public class Tugas2MergeSort {
    /** Membuat Function Sort 
     *  Berfungsi untuk membagi array menjadi 2 bagian secara rekursif,
     *  Kemudian mengurutkannya secara Descending dari Terbesar
     *  Sampai Terkecil
     **/
    
    void sort(int arr[], int l, int r){
        
        System.out.println();
        System.out.println("Memanggil Function Sort(arr, " + l + ", " + r + ") : bagian saat ini " + Arrays.toString(Arrays.copyOfRange(arr, l, r + 1)));
        
        if(l < r)
        {
            int m = (l + r) / 2;
            System.out.println("  Membagi Menjadi 2 Bagian : [" + l + ".." + m + "] dan [" + (m+1) + ".." + r + "]"); 
            
            /** Urutkan Bagian Kiri **/
            sort(arr, l, m);
            
            /** Urutkan Bagian Kanan **/
            sort(arr, m + 1, r);
            
            /** Gabungkan 2 Bagian yang sudah terurut secara Descending **/
            merge(arr, l, m, r);
            
        } else {
            /** Tidak perlu diurutkan, karena hanya ada 1 elemen saja **/
            System.out.println("  Bagian["+l+".."+ r +"] hanya satu elemen, tidak perlu diurutkan");
        }
        
    }
    
    
    
    /** Membuat Function Merge 
     * Untuk menggabungkan 2 bagian array yang sudah terurut 
     */
    
    void merge(int[] arr, int l, int m, int r) 
    {
        int n1 = m - l + 1;
        int n2 = r - m;
        
        int L[] = new int[n1];
        int R[] = new int[n2];
        
        /** Menyalin elemen ke array sementara L & R **/
        for(int i = 0; i < n1; i++)
        {
            L[i] = arr[l + i];
        }
        
        for(int j = 0; j < n2; j++){
            R[j] = arr[m + 1 + j];
        }
        
        System.out.println();
        System.out.println("Memulai proses Merge untuk indeks ["+l+".."+m+"] dan ["+(m+1)+".."+r+"]");
        System.out.println("  Bagian Kiri (L) : " + Arrays.toString(L));
        System.out.println("  Bagian Kanan (R) : " + Arrays.toString(R));
        
        int i = 0, j = 0;
        int k = l;
        
        /** Membandingkan elemen dari L dan R lalu dimasukan kedalam array utama arr **/
        while (i < n1 && j < n2)
        {
            System.out.println("  Bandingkan L["+i+"] = " + L[i] + " dengan R["+j+"] = " + R[j]);
            
            if(L[i] >= R[j])
            {
                arr[k] = L[i];
                System.out.println("    Ambil L["+i+"] = " + L[i] + " ke arr["+k+"]");
                i++;
            } else {
                arr[k] = R[j];
                System.out.println("    Ambil R["+j+"] = " + R[j] + " ke arr["+k+"]");
                j++;
            }
            k++;
            System.out.println("      Hasil sementara : " + Arrays.toString(arr));
        }
        
        /** Jika masih ada sisa elemen di L, masukkan ke array utama arr. **/
        while(i < n1)
        {
            arr[k] = L[i];
            i++;
            k++;
        }
        /** Jika masih ada sisa elemen di R, masukkan ke array utama arr. **/
        while(j < n2)
        {
            arr[k] = R[j];
            j++;
            k++;
        }
        
        System.out.println("  Selesai merge untuk indeks ["+l+".."+r+"]: " + Arrays.toString(Arrays.copyOfRange(arr, l, r + 1)));
        
    }
    
    
    /** Membuat Function untuk mencetak isi array, selain menggunakan Library Arrays.**/
    static void printArray(int arr[])
    {
        int n = arr.length;
        for(int i = 0; i < n; i++)
        {
            System.out.print(arr[i] + " ");
        }
        System.out.println();
    }
    
    
    /** Membuat Function Main **/
    public static void main(String args[]) {
        /** Membuat Variabel yang akan diurutkan menggunakan merge sort **/
        int a1 = 25;
        int a2 = 7;
        int a3 = 18;
        int a4 = 42;
        int a5 = 13;
        int a6 = 9;
        int a7 = 31;
        int a8 = 2;
        
        int arr[] = {a1, a2, a3, a4, a5, a6, a7, a8};
        
        /** menampilkan array awal **/
        System.out.println("Array awal : ");
        printArray(arr);
        
        /** Process Merge Sort **/
        Tugas2MergeSort ob = new Tugas2MergeSort();
        ob.sort(arr, 0, arr.length - 1);
        
        System.out.println();
        System.out.println("Hasil array menggunakan Merge Sort secara Descending : ");
        printArray(arr);
        
        /** Analisa Algoritma Merge Sort **/
        String hasilAnalisa = """
                              ==================================================
                              KESIMPULAN ALGORITMA MERGE SORT
                              ==================================================
                              
                              Merge Sort adalah algoritma pengurutan dengan konsep
                              'divide dan conquer', dimana : 
                              - Membagi array menjadi dua bagian secara rekursif (divide)
                              - Mengurutkan kembali tiap bagian yang terpisah
                              - Menggabungkan kembali 2 bagian secara terurut.
                              
                              Kelebihan :
                              - Stabil dan efisien untuk data besar
                              - Waktu eksekusi konsisten di semua kasus
                              
                              Kekurangan : 
                              - Membutuhkan memori tambahan (untuk array sementara)
                              - Kurang efisien untuk data kecil
                              
                              Dari Source Code ini, Contoh Hasilnya : 
                              Array Awal : [25, 7, 18, 42, 13, 9, 31, 2]
                              Hasil Akhirnya : [42, 31, 25, 18, 13, 9, 7, 2]
                              """;
        
        System.out.println(hasilAnalisa);

    }
    
}

template:
  - trigger:
      - platform: event
        event_type: set_variable
      - platform: event
        event_type: remove_variable
      - platform: event
        event_type: clear_variables
    condition:
      - condition: template
        value_template: >
          {{
              (
                trigger.event.event_type == 'set_variable'
                and trigger.event.data is defined
                and trigger.event.data.key is defined
                and trigger.event.data.value is defined
              )
              or
              (
                trigger.event.event_type == 'remove_variable'
                and trigger.event.data is defined
                and trigger.event.data.key is defined
              )
              or 
              trigger.event.event_type == 'clear_variables'
          }}
    action:
      - if: "{{ trigger.event.data.get('log', state_attr('sensor.variables', 'log_events')) }}"
        then:
          - service: logbook.log
            data:
              name: "{{ trigger.event.event_type }}:"
              message: >
                {{ trigger.event.data.key | default('All variables removed') }}
                {%- if trigger.event.event_type == 'set_variable' -%}
                  : {{ trigger.event.data.value }}.
                {%- endif -%}
    sensor:
      - unique_id: 4a4c8e53-9e68-4198-9cc5-b336e228ea4d
        name: Variables
        state: Variables
        attributes:
          default_timestamp: false
          log_events: false
          variables: >
            {% set others = dict(this.attributes.get('variables', {}).items() | rejectattr('0', 'eq', trigger.event.data.key)) %}
            {% if trigger.event.event_type == 'set_variable'
                and trigger.event.data.get('set_timestamp', this.attributes.get('default_timestamp', false))
            %}
              {% set value  = trigger.event.data.value %}
              {% set value = value.isoformat() if value is datetime else value %}
              {% set new = {trigger.event.data.key: {'value': value, 'timestamp': now().isoformat()}} %}
              {{ dict(others, **new) }}
            {% elif trigger.event.event_type == 'set_variable' %}
              {% set new = {trigger.event.data.key: trigger.event.data.value} %}
              {{ dict(others, **new) }}
            {% elif trigger.event.event_type == 'remove_variable' %}
              {{ others }}
            {% elif trigger.event.event_type == 'clear_variables' %}
              {}
            {% endif %}

import frappe
import json
from frappe.auth import LoginManager

@frappe.whitelist(allow_guest=True)
def customer_login():
    """
    Handles customer signin by validating user credentials.
    """

    form_data = json.loads(frappe.request.data)

    login_manager = LoginManager()
    login_manager.authenticate(form_data.get("email"), form_data.get("password"))
    login_manager.post_login()

    if frappe.response["message"] == "Logged In":
        user = login_manager.user
		user_details = frappe.get_doc("User", user)
		
        frappe.response["user_details"] = { "api_key" : user_details.api_key,
											"api_secret" : user_details.get_password("api_secret") }
    else:
        return False


@frappe.whitelist(allow_guest=True)
def forgot_password():
    # Get the form data from the request
    form_data = json.loads(frappe.request.data)

    if not frappe.db.exists("User", form_data.get("email")):
        return {"error": "User with this email does not exist"}

    if send_login_link(form_data.get("email")):
        return {"data": "Password reset link sent to your email."}

